276=当锋哥发了一张龙图导致其在隔壁群被口球，这叫消息传递。&enter&yf先下手为强先把锋哥烟了，发了一张龙图，然后才把锋哥解了，这叫互斥访问。&enter&锋哥和yf同时把对方烟了，谁都发不出龙图，这叫死锁。&enter&锋哥和yf同时说“如果对方发龙图，我就发龙图”但谁也不发，这叫活锁。&enter&你发龙图都要先问一下yf能不能发，如果别人正在上传龙图但没发送，yf就会让你等一下，等别人发完了，你才能开始上传龙图，这叫监视器。&enter&你连问几次能不能发龙图，yf都说别人正在发龙图，你还不能发，结果锋哥发了10张龙图你一张都没发出去，这叫进程饥饿。&enter&当你在osu新人mapper群里发了句“发张龙图”结果锋哥yf英梨梨都发了一张龙图，这叫SIMD。&enter&当你把两条发龙图的命令放在同一个消息里发出去了，龙图bot竟然响应了，还发了两张龙图，这叫超长指令字。&enter&当你对锋哥连打了两条“发张龙图”，结果锋哥在同一条消息里发了两张龙图，这叫超标量。&enter&当你对锋哥连打了三条“发张龙图”，结果锋哥只发了三张龙图的上半部分，下半部分同时由yf发出来了，这叫流水线。&enter&锋哥发了一张龙图，被烟了，你复读了一下，也被烟了，这叫继承。&enter&锋哥发了一张龙图，你没问他龙图是哪来的，就保存收藏了并转发隔壁群，这叫封装。&enter&锋哥发了一张龙图，被烟了，你、英梨梨和yf都复读了，结果你被烟了，英梨梨被撤回了，yf屁事没有，这叫多态。&enter&yf宣布在群里只允许通过龙图bot发送龙图，大家可以在群里输入龙图的编号来发送龙图，这叫枚举类型。&enter&当你在群里说“发张龙图”，有人发了托尔康娜的百合图片，有人发了龙女士，还有人分享了量子海的成绩截图，于是yf把他们都当成龙小鬼烟了，这叫鸭子类型。&enter&yf给龙图bot开发了自定义配字的功能，群友只要输入命令就可以发送不同内容的龙图，这叫工厂方法。&enter&yf扩充了龙图bot，除了自定义龙图，现在还可以发京图、学友、金馆长，但是这些功能需要把各加一个新的bot账号到群里来，这叫抽象工厂。&enter&群友在群里复读了同一张龙图几十遍，但是服务器上其实只保留了一张龙图的内容，这叫单例。&enter&锋哥发了一张龙图表情，英梨梨给锋哥的发言截了个图，结果成了新的表情风靡全群，这叫修饰。
