1703=《我家跨上了信息高速路》&enter&&enter&&enter&“太好啦！大好啦！”听妈妈说，我家的电脑跨上了信息高速路，我不知所云地欢呼起来。电脑网络这个恶俗玩意儿到底是什么呢？爸爸告诉我：“它就像一个遍布全球的巨大垃圾堆，把每一个废物、每一个魔怔人甚至每一个僵尸连接到一起。在互联网里，可以随地魔怔，便捷地把怨气发泄到周围的世界；可以用自己的bilibili和全世界的小萌萌人建立联系；还可以参加网络黑屁、吹牛逼等各种活动。有了网络，咱们的地球就变成了一个小垃圾堆，五洲四海的人们可以随时进行别样的键盘大战。”&enter&&enter&网络真的这么神奇？我带着好奇心，迫不及待地叫妈妈打开电脑，进入网络。不一会儿，我们家的户籍就出现在电脑屏幕上。我目不转睛地盯着屏幕，爸爸、妈妈、我......这些说着狠话的怪人们都笑眯眯地看着我，还用着我的照片做出各种有趣的图片。“真神了！”我不由得赞叹起来。&enter&&enter&妈妈还带我访问了一些其他的网站，里面的乐子太丰富了，有淫梦小鬼，有恶俗克星，有黑界骡子，有抽象蛤蟆……真是应有尽有，我感到圈子一下子变小了，王道征途的大门向我敞开。&enter&&enter&妈妈又教我发电子邮件。我试着给远在国外的表姐发了一封我自己用电脑PS的恶俗抽象画，结果被GFW挡住了。爸爸看着我，羡慕地说：你们这一代真是大幸福了。我们小时候哪有什么PS，有事只能坐火车过去真人快打。现在可方便多了，仅仅几秒钟，就可以向国外发一封指点江山的邮件，而且还会被墙。科学技术发展得多快呀！”妈妈说：“是呀，科学上网还能被国安局警告、上门拜访呢！”&enter&&enter&我恋恋不舍地下了网，愣愣地看着爸爸妈妈，心思还在那神奇的网络世界里呢！爸爸说：“你再多上几次网，我们就可以打电话给杨永信带你去电击治疗了呢！”妈妈说：“网络世界我操你妈！！！你他妈把多少人的生活！！！都他妈毁了！！！”我听了，更加喜欢网络这个新朋友了。我盼望着再次进入奇妙的网络世界。
