1756=一氧化碳经呼吸道进入人体后,与血液中的血红蛋白结合,形成稳定的炭氧血红蛋白,随血流分布全身,一氧化碳与血红蛋白的亲和力比氧和血红蛋白的亲和力大200－300倍,因此与氧争夺血红蛋白并结合牢固,致使血红蛋白携氧能力大大降低.造成全身缺氧血症.人的中枢神经系统对缺氧最为敏感,因此当缺氧时,脑组织最先受累,造成脑功能障碍,脑水肿,直接威胁生命.&enter&它进入肺泡后很快会和血红蛋白(Hb)产生很强的亲合力,使血红蛋白形成碳氧血红蛋白(COHb),阻止氧和血红蛋白的结合.血红蛋白与一氧化碳的亲合力要比与氧的亲合力大200~300倍,同时碳氧血红蛋白的解离速度却比氧合血红蛋白的解离慢3600倍.一旦碳氧血红蛋白浓度升高,血红蛋白向机体组织运载氧的功能就会受到阻碍,进而影响对供氧不足最为敏感的中枢神经(大脑)和心肌功能,造成组织 缺氧,从而使人产生中毒症状.
